import requests
import json

data = {
	"bg_prompt" : "sunny day after the snowfall",
	"bg_nprompt" : "deformed, ugly, ((noisy))",
	"fg_prompt" : ["photo of a andriod robot", "photo of a robotic arm"],
	"fg_nprompt" : "deformed, ugly, ((noisy))",
	"width" : "512",
	"height" : "512",
	"ddim_steps" : "35",
	"bootstrapping" : "20",
	"seed" : "33",
	"masks" : ["",
    ""]
}


# print(data)

# Define the JSON object you want to send
# data = {"name": "John", "age": 30, "city": "New York"}

# Define the API endpoint you want to send the JSON object to
url = "http://3.85.56.117:5000/multsd"

# Set the headers for the request (content-type is important for JSON)
headers = {"Content-Type": "application/json"}

# Use the requests library to make a POST request with the JSON object
response = requests.post(url, data=json.dumps(data), headers=headers)

# Check the status code of the response (200 means success)
if response.status_code == 200:
    print("Request successful!")
else:
    print("Request failed with status code:", response.status_code)
